public int countClumps(int[] nums) {
    int clumpCount = 0;
    int i = 0;

    while (i < nums.length) {
        int count = 1;
        while (i + 1 < nums.length && nums[i] == nums[i + 1]) {
            i++;
            count++;
        }
        if (count > 1) {
            clumpCount++;
        }
        i++;
    }

    return clumpCount;
}

